    [],nt"revision_timestamp": "2015-09-27T00:02:28.651612",nt"name": "multichannel-seismic-reflection-data-scar-wilkes-land-1983-sdls-cd-rom-vol-10",nt"isopen":
    false,nt"url": null,nt"notes": "These data are stacked multichannel marine
    seismic reflection data from thirteen lines recorded during 1983 off Wilkes Island,
    Antarctica, by the Japan National Oil Corporation. The following data types are
    included for each line: computer display images, location maps, and the digital
    seismic data. Software is provided to view the images, to plot selected portions
    of the data to the screen, and to convert the data into SEG-Y formation. The CD-ROM
    was produced in accordance with the ISO 9660 Standard. The display software runs
    only under DOS. All text files are in ASCII format.",nt"license_title": null,nt"extras":
